import React from 'react'
import '../index.css';
import Timeline from './Timeline';

function Experience() {
  return (
    <div className='bg-[#242422]'>
      <div className='Headings'>
        <h1 className='text-6xl font-bold text-center pt-20 text-[#38bdf8]'>Resume</h1>
        <h2 className='text-2xl text-center my-3 text-white'>Some Of My Experience!</h2>
        <p className='text-xl text-center text-[#a3a3a3] font-serif'>Here are my work experiences and education.</p>
        <h3 className='mx-20 text-4xl mt-20 mb-10 text-center text-white'>Work Experience</h3>
      </div>

        <div className='flex flex-col justify-center items-center text-white text-base pb-8 sm:text-lg'>
            <Timeline defaultColor="bg-sky-400"></Timeline>
        </div>
    </div>
  )
}

export default Experience
